import { useState } from "react";
import "./styles.css";

export default function ListingAd({ 
  pic, 
  title,
  address,
  description,
  project_type,
  year,
  ownership_type,
  psf_min,
  psf_max,
  subprice_label,
  availabilities_label,
  clickable_num1,
  descriptionMiddle,
  clickable_num2,
  descriptionMiddle3,
  clickable_num3,
  descriptionEnd
}) {
  const [showDescription, setShowDescription] = useState(false);
  const [revealPhoneNumber, setRevealPhoneNumber] = useState(false);

  // Helper function to anonymize phone numbers
  const anonymizePhoneNumber = (phoneNumber) => {
    const visibleDigits = phoneNumber.slice(0, 4);
    const anonymizedDigits = "X".repeat(4);
    return `${visibleDigits} ${anonymizedDigits}`;
  };

  const toggleDescription = () => {
    setShowDescription(!showDescription);
  };

  const togglePhoneNumber = () => {
    setRevealPhoneNumber(!revealPhoneNumber);
  };

  const formatDescription = (description) => {
    const regex = /Phone Number: (\d+)/g;
    const formattedDescription = description.replace(regex, (match, phoneNumber) => {
      if (revealPhoneNumber) {
        return anonymizePhoneNumber(phoneNumber);
      } else {
        return `Phone Number: ${anonymizePhoneNumber(phoneNumber)}`;
      }
    });
    return formattedDescription;
  };

  return (
    <div className="App">
    <div className="image-container">
      <div className="image-wrapper">
        <div className="carousel">
          <img src="/chevron-left.svg"></img>
          <img src="/chevron-right.svg"></img>
        </div>
      </div>
      <img className="property-image"  src={pic}></img>
    </div>
    <div className="mainContent">
      <div className="mainContent-header">
        <div className="mainContent-details">
          <div className="mainContent-title-container">
            <img src="/building-icon.svg" className="test"></img>
            <div className="header-styling">
              <p className="header-styling-title">{title}</p>
              <p className="property-address">{address}</p>
            </div>
          </div>
          <div className="property-type-container">
              <p className="property-type">{project_type} · {year} · {ownership_type}</p>
              <p className="availabilities-label">{availabilities_label}</p>
            </div>
            </div>
          <div className="property-price">
              <p className="price-psf"> ${psf_min} - ${psf_max} psf</p>
              <p className="price-sublabel">{subprice_label}</p>
          </div>
      </div>
      <div>
      <button onClick={toggleDescription}>
        {showDescription ? "Hide Description" : "Show Description"}
      </button>
      {showDescription && (
        <p>
          {formatDescription(description).split("\n").map((line, index) => (
            <span key={index}>
              {line}
              <br />
            </span>
          ))}
          <br />
          <span onClick={togglePhoneNumber}>
            {revealPhoneNumber ? "Click to hide phone number" : "Click to reveal phone number"}
          </span>
          <br />
          {revealPhoneNumber ? "82345678" : anonymizePhoneNumber("82345678")} 
          {revealPhoneNumber && <span onClick={() => console.log("82345678")}>Hide full number</span>}
        </p>
      )}
    </div>
    </div>
    </div>
  );
}
